import React from "react";
import { Col } from "react-bootstrap";

const ProfileContent = ({ children }) => {
  return (
    <Col sm={8}>
      <div>
        <div className="vh-100 p-0">
          <main>{children}</main>
        </div>
      </div>
    </Col>
  );
};

export default ProfileContent;
